```js
const { pipeline } = require('stream');
const { Transform } = require('stream');
const { createReadStream, createWriteStream } = require('fs');

function base64Transform() {
  return new Transform({
    transform(chunk, encoding, callback) {
      const base64Data = chunk.toString('base64');
      callback(null, base64Data);
    }
  });
}

function encodeFileToBase64(inputFilePath, outputFilePath) {
  const readableStream = createReadStream(inputFilePath);
  const writableStream = createWriteStream(outputFilePath);
  const base64Stream = base64Transform();

  pipeline(
    readableStream,
    base64Stream,
    writableStream,
    (err) => {
      if (err) {
        console.error('Pipeline failed.', err);
      } else {
        console.log('Pipeline succeeded.');
      }
    }
  );
}

// Example usage:
encodeFileToBase64('input.txt', 'output.txt');
```
In this example, the `base64Transform` function returns a new `Transform` stream that encodes each chunk of data it receives as base64. The `encodeFileToBase64` function creates a `ReadableStream` from an input file, pipes it through the `base64Transform` function, and pipes the resulting data out to a `WritableStream` to an output file. The `pipeline` function from the `stream` module is used to handle the piping and error handling.

